Private's Christmas movie delivers five fresh stunning scenes that prove it is often as good to receive as it is to give! Featuring a naughty step-daughter hungry for a load of Christmas spirit, a black tree deliveryman with a big package, a company celebration dinner where stuffing is on the menu, a shopping trip where the staff understand full service, and a cuckold husband who gives his wife a man who can make her Christmas very merry indeed. Starring Alexis Crystal, Anna Rose, Jenny Simons, Billie Star and Samantha Joons. With Private, Christmas comes more than once a year. Happy Holidays!

